    internal class AssignmentStatusConverter : JsonConverter
    {
        public override bool CanConvert(Type t) => t == typeof(AssignmentStatus) || t == typeof(AssignmentStatus?);

        public override object ReadJson(JsonReader reader, Type t, object existingValue, JsonSerializer serializer)
        {
            if (reader.TokenType == JsonToken.Null) return null;
            var value = serializer.Deserialize<string>(reader);
            switch (value)
            {
                case "ACCEPTED":
                    return AssignmentStatus.Accepted;
                case "AUCTION":
                    return AssignmentStatus.Auction;
                case "AUCTION_REQUEST_FOR_UNASSIGN":
                    return AssignmentStatus.AuctionRequestForUnassign;
                case "REQUEST_FOR_ASSIGNMENT":
                    return AssignmentStatus.RequestForAssignment;
            }
            throw new Exception("Cannot unmarshal type AssignmentStatus");
        }

        public override void WriteJson(JsonWriter writer, object untypedValue, JsonSerializer serializer)
        {
            if (untypedValue == null)
            {
                serializer.Serialize(writer, null);
                return;
            }
            var value = (AssignmentStatus)untypedValue;
            switch (value)
            {
                case AssignmentStatus.Accepted:
                    serializer.Serialize(writer, "ACCEPTED");
                    return;
                case AssignmentStatus.Auction:
                    serializer.Serialize(writer, "AUCTION");
                    return;
                case AssignmentStatus.AuctionRequestForUnassign:
                    serializer.Serialize(writer, "AUCTION_REQUEST_FOR_UNASSIGN");
                    return;
                case AssignmentStatus.RequestForAssignment:
                    serializer.Serialize(writer, "REQUEST_FOR_ASSIGNMENT");
                    return;
            }
            throw new Exception("Cannot marshal type AssignmentStatus");
        }

        public static readonly AssignmentStatusConverter Singleton = new AssignmentStatusConverter();
    }

